import datatable3 from "layouts/authentication/error/datatable3";
import SuiDatePicker from "components/SuiDatePicker";
import { useState } from "react";
import Checkbox from "@mui/material/Checkbox";
import PropTypes from "prop-types";

function IdCell({ id, checked } ) {

    IdCell.defaultProps = {
        checked: false,
    };

    // Typechecking props for the IdCell
    IdCell.propTypes = {
        id: PropTypes.string.isRequired,
        checked: PropTypes.bool,
    };

    const [endDate, setEndDate] = useState(new Date());


    const handleSetEndDate = (newDate) => setEndDate(newDate);



    const passwordRequirements = [

    ];


    const renderPasswordRequirements = passwordRequirements.map((item, key) => {
        const itemKey = `element-${key}`;

        return (

            <SuiBox key={itemKey} component="li" color="text" fontSize="1.25rem" lineHeight={1}>
                <SuiTypography
                    variant="button"
                    textColor="text"
                    fontWeight="regular"
                    verticalAlign="middle"
                >
                    {item}
                </SuiTypography>
            </SuiBox>
        );
    });

